INSERT INTO `panel_updates` (`id`, `title`, `text`, `textshort`, `admin`, `date`) VALUES
(1, 'UPDATE', '<p>&nbsp;</p><p>- Rezolvate majoritatea bugurilor raportate pe serverul de discord.<br>- Adaugat sistem de pin pe care il adaugati doar cand conectarea voastra pe server se face de pe un alt ip.<br>- Adaugat sistem de Laptop pe care-l puteti avea in propria casa.<br>- Adaugat business-ul ''''Computer Coffee'''' unde va puteti duce sa navigati pe internet.<br>- Au fost actualizate si puse la punct toate factiunile de pe server.<br>- Adaugate noi crate-uri pe server.<br>-Adaugat sistem inedit de job-goal.<br>-Au fost adaugate 26 de case pe server.<br>- Au fost adaugate 30 de business-uri pe server.<br>- Sistemul de DealerShip este incorporat pe laptop.<br>- Au fost adaugate 8 job-uri pe server.<br>-Pentru a avansa in nivel ai nevoie de puncte de experienta, nu de respect points.<br>-Adaugat sistem de Aky Points.<br>- Adaugat sistem nou de rob. Acum nu mai folositi comanda /rob, ci indreptati arma spre NPC ul din fiecare business. (Deagle)<br>- A fost adaugat sistem de /getgift.<br>- Adaugat sistem de licente, o licenta iti expira la 7 zile de la achizitionarea acesteia chiar daca esti online pe server sau nu.<br>- Au fost adaugate noi turf-uri pentru mafioti.</p>', '<p>- Rezolvate majoritatea bugurilor raportate pe serverul de discord.<br />\n- Adaugat sistem de pin pe care il adaugati doar cand conectarea voastra pe server se face de pe un alt ip.<br />\n- Adaugat sistem de Laptop pe care-l puteti avea in propria casa.<br />\n- Adaugat business-ul ''''Computer Coff', '257', '2021-11-28 19:30:20');
